import React from "react";

const Cart = ({ cartItems }) => {
  return (
    <div>
      <h2>Cart Items</h2>
      <ul>
        {cartItems.map((item, index) => (
          <li key={index}>
            {item.category} - {item.price}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Cart;
